{"go.json":"{
	// Place your snippets for go here. Each snippet is defined under a snippet name and has a prefix, body and 
	// description. The prefix is what is used to trigger the snippet and the body will be expanded and inserted. Possible variables are:
	// $1, $2 for tab stops, $0 for the final cursor position, and ${1:label}, ${2:another} for placeholders. Placeholders with the 
	// same ids are connected.
	// Example:
	// "Print to console": {
	// 	"prefix": "log",
	// 	"body": [
	// 		"console.log('$1');",
	// 		"$2"
	// 	],
	// 	"description": "Log output to console"
	// }
	"Error handle": {
		"prefix": "errnil",
		"body": [
			"if err != nil {",
			"    $1",
			"}"
		]
	},
	"Infinity loop": {
		"prefix": "ifor",
		"body": [
			"for {",
			"\t$1",
			"}"
		]
	},
	"Define new method": {
		"prefix": "method",
		"body": [
			"func ($1 *$2) $3($4) $5 {",
			"\t$6",
			"}"
		]
	},
	"Multiple constansts": {
		"prefix": "consts",
		"body": [
			"const (",
			"    $1",
			")"
		]
	},
	"Multiple variables": {
		"prefix": "vars",
		"body": [
			"var (",
			"    $1",
			")"
		]
	},
	"Select construction": {
		"prefix": "select",
		"body": [
			"select {",
			"case $1:",
			"\t$2",
			"}"
		]
	},
	"Struct placeholder": {
		"prefix": "struct",
		"body": [
			"type $1 struct {",
			"\t$2",
			"}"
		],
	},
	"Implement interface": {
		"prefix": "implement",
		"body": [
			"// $1 *$2"
		],
	}
}"}
